app.controller("contactController",["$scope","contactFactory",(e,t)=>{$("#contactForm").form({keyboardShortcuts:!1,on:"blur",inline:!0,fields:{title:{identifier:"name",rules:[{type:"empty",prompt:"Please enter a name."}]},email:{identifier:"email",rules:[{type:"empty",prompt:"Please enter a email."},{type:"email",prompt:"Please enter a valid email."}]},message:{identifier:"message",rules:[{type:"empty",prompt:"Please enter a message."},{type:"maxLength[2000]",prompt:"Your message can be up to {ruleValue} characters long."}]}},onSuccess:()=>{e.onSubmit()}}),e.contactForm={},e.onSubmit=(()=>{t.sendMessage(e.contactForm).then(e=>{console.log(e)})})}]);